app.controller("indexController",["$scope","$http","indexFactory","countriesFactory","categoriesFactory",(e,t,n,o,i)=>{e.indexAdsLoading=!0,e.init=(()=>{n.getIndexAds().then(t=>{e.indexAdsLoading=!1,e.ads=t}),o.getCountries().then(t=>{e.countries=t}),i.getCategories().then(t=>{e.categories=t})}),e.searchForm={},e.onSubmit=(()=>{e.indexAdsLoading=!0,n.searchAd(e.searchForm.title).then(t=>{e.indexAdsLoading=!1,e.ads=t})})}]);